INSERT INTO `wp_posts` VALUES (90,1,'2024-06-05 17:10:20','2024-06-05 17:10:20','<!-- wp:embed {\"url\":\"https://vimeo.com/949988329?share=copy\",\"type\":\"video\",\"providerNameSlug\":\"vimeo\",\"responsive\":true,\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed is-type-video is-provider-vimeo wp-block-embed-vimeo wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://vimeo.com/949988329?share=copy\n</div></figure>\n<!-- /wp:embed -->\n\n<!-- wp:group {\"align\":\"full\",\"style\":{\"spacing\":{\"padding\":{\"top\":\"var:preset|spacing|50\",\"bottom\":\"var:preset|spacing|50\",\"left\":\"var:preset|spacing|50\",\"right\":\"var:preset|spacing|50\"},\"margin\":{\"top\":\"0\",\"bottom\":\"0\"}}},\"backgroundColor\":\"base\",\"layout\":{\"type\":\"constrained\"}} -->\n<div class=\"wp-block-group alignfull has-base-background-color has-background\" style=\"margin-top:0;margin-bottom:0;padding-top:var(--wp--preset--spacing--50);padding-right:var(--wp--preset--spacing--50);padding-bottom:var(--wp--preset--spacing--50);padding-left:var(--wp--preset--spacing--50)\"><!-- wp:columns {\"align\":\"wide\",\"style\":{\"spacing\":{\"blockGap\":{\"top\":\"var:preset|spacing|40\",\"left\":\"var:preset|spacing|30\"}}}} -->\n<div class=\"wp-block-columns alignwide\"><!-- wp:column {\"width\":\"40%\",\"layout\":{\"type\":\"constrained\",\"contentSize\":\"260px\",\"justifyContent\":\"left\"}} -->\n<div class=\"wp-block-column\" style=\"flex-basis:40%\"><!-- wp:paragraph {\"style\":{\"spacing\":{\"padding\":{\"top\":\"10px\",\"bottom\":\"10px\"}},\"typography\":{\"lineHeight\":\"2\"},\"elements\":{\"link\":{\"color\":{\"text\":\"var:preset|color|contrast\"}}}},\"textColor\":\"contrast\",\"fontSize\":\"small\"} -->\n<p class=\"has-contrast-color has-text-color has-link-color has-small-font-size\" style=\"padding-top:10px;padding-bottom:10px;line-height:2\"><br>Personal project (Feb 2024) <br><strong>Tools: </strong>Procreate dreams</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":\"60%\",\"style\":{\"spacing\":{\"blockGap\":\"var:preset|spacing|40\"}}} -->\n<div class=\"wp-block-column\" style=\"flex-basis:60%\"><!-- wp:paragraph {\"style\":{\"typography\":{\"lineHeight\":\"1.2\"}},\"fontSize\":\"x-large\",\"fontFamily\":\"heading\"} -->\n<p class=\"has-heading-font-family has-x-large-font-size\" style=\"line-height:1.2\">Animated dunk</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns {\"style\":{\"spacing\":{\"blockGap\":{\"top\":\"var:preset|spacing|30\",\"left\":\"var:preset|spacing|30\"}}}} -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph {\"style\":{\"layout\":{\"selfStretch\":\"fill\",\"flexSize\":null}}} -->\n<p>Floating through the skies, papa jump defying physics. Following through Numencaniq\'s  <a href=\"https://www.domestika.org/en/courses/235-animacion-2d-con-photoshop-dibujo-camara-y-accion\">2D camera course</a>, which is focused on framing and camera movements, I went through an experimentation path with Procreate Dreams. Organizing and planning a complex scene required an intense use of anatomy and imagination.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:group -->\n\n<!-- wp:group {\"style\":{\"spacing\":{\"padding\":{\"top\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"right\":\"0\"},\"blockGap\":\"0\",\"margin\":{\"top\":\"0\",\"bottom\":\"0\"}},\"dimensions\":{\"minHeight\":\"0px\"},\"border\":{\"radius\":\"0px\"}},\"layout\":{\"type\":\"default\"}} -->\n<div class=\"wp-block-group\" style=\"border-radius:0px;min-height:0px;margin-top:0;margin-bottom:0;padding-top:0;padding-right:0;padding-bottom:0;padding-left:0\"><!-- wp:group {\"style\":{\"spacing\":{\"padding\":{\"top\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"right\":\"0\"},\"margin\":{\"top\":\"0\",\"bottom\":\"0\"},\"blockGap\":\"0\"},\"dimensions\":{\"minHeight\":\"0px\"},\"border\":{\"width\":\"0px\",\"style\":\"none\",\"radius\":\"0px\"}},\"layout\":{\"type\":\"constrained\",\"contentSize\":\"1200px\"}} -->\n<div class=\"wp-block-group\" style=\"border-style:none;border-width:0px;border-radius:0px;min-height:0px;margin-top:0;margin-bottom:0;padding-top:0;padding-right:0;padding-bottom:0;padding-left:0\"><!-- wp:group {\"style\":{\"spacing\":{\"blockGap\":\"var:preset|spacing|10\",\"margin\":{\"top\":\"0\",\"bottom\":\"0\"},\"padding\":{\"right\":\"0\",\"left\":\"0\",\"top\":\"0\",\"bottom\":\"0\"}},\"border\":{\"width\":\"0px\",\"style\":\"none\"}},\"className\":\"pj-contentrow1\",\"layout\":{\"type\":\"flex\",\"flexWrap\":\"nowrap\",\"orientation\":\"horizontal\",\"verticalAlignment\":\"center\",\"justifyContent\":\"center\"}} -->\n<div class=\"wp-block-group pj-contentrow1\" style=\"border-style:none;border-width:0px;margin-top:0;margin-bottom:0;padding-top:0;padding-right:0;padding-bottom:0;padding-left:0\"><!-- wp:image {\"id\":84,\"sizeSlug\":\"full\",\"linkDestination\":\"none\",\"align\":\"right\"} -->\n<figure class=\"wp-block-image alignright size-full\"><img src=\"http://localhost:10003/wp-content/uploads/2024/06/character.png\" alt=\"\" class=\"wp-image-84\"/><figcaption class=\"wp-element-caption\">First step, making a character design with simplifed shapes, I added some personal notes to remember my character when animating.</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":86,\"sizeSlug\":\"full\",\"linkDestination\":\"none\",\"align\":\"right\"} -->\n<figure class=\"wp-block-image alignright size-full\"><img src=\"http://localhost:10003/wp-content/uploads/2024/06/poses.png\" alt=\"\" class=\"wp-image-86\"/><figcaption class=\"wp-element-caption\">Step two: I used some basketball references and practice gesture. </figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":85,\"scale\":\"contain\",\"sizeSlug\":\"full\",\"linkDestination\":\"none\",\"align\":\"left\"} -->\n<figure class=\"wp-block-image alignleft size-full\"><img src=\"http://localhost:10003/wp-content/uploads/2024/06/head.gif\" alt=\"\" class=\"wp-image-85\" style=\"object-fit:contain\"/><figcaption class=\"wp-element-caption\">Step three: A head turnout was very useful for practicing proportions and help me when getting into complex camera movements.</figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:group -->\n\n<!-- wp:group {\"style\":{\"spacing\":{\"blockGap\":\"var:preset|spacing|10\",\"padding\":{\"right\":\"0\",\"left\":\"0\",\"top\":\"0\",\"bottom\":\"0\"},\"margin\":{\"top\":\"0\",\"bottom\":\"0\"}},\"dimensions\":{\"minHeight\":\"0px\"},\"border\":{\"width\":\"0px\",\"style\":\"none\"}},\"className\":\"pj-contentrow2\",\"layout\":{\"type\":\"flex\",\"flexWrap\":\"nowrap\",\"orientation\":\"horizontal\",\"verticalAlignment\":\"bottom\",\"justifyContent\":\"center\"}} -->\n<div class=\"wp-block-group pj-contentrow2\" style=\"border-style:none;border-width:0px;min-height:0px;margin-top:0;margin-bottom:0;padding-top:0;padding-right:0;padding-bottom:0;padding-left:0\"><!-- wp:image {\"id\":45,\"width\":\"auto\",\"height\":\"600px\",\"aspectRatio\":\"16/9\",\"scale\":\"contain\",\"sizeSlug\":\"full\",\"linkDestination\":\"none\",\"align\":\"right\"} -->\n<figure class=\"wp-block-image alignright size-full is-resized\"><img src=\"http://localhost:10003/wp-content/uploads/2024/05/planning.gif\" alt=\"\" class=\"wp-image-45\" style=\"aspect-ratio:16/9;object-fit:contain;width:auto;height:600px\"/><figcaption class=\"wp-element-caption\">asdsd</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":28,\"width\":\"600px\",\"height\":\"600px\",\"scale\":\"contain\",\"sizeSlug\":\"full\",\"linkDestination\":\"none\",\"align\":\"left\"} -->\n<figure class=\"wp-block-