rong>Tools: </strong>Procreate dreams</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":\"60%\",\"style\":{\"spacing\":{\"blockGap\":\"var:preset|spacing|40\"}}} -->\n<div class=\"wp-block-column\" style=\"flex-basis:60%\"><!-- wp:paragraph {\"style\":{\"typography\":{\"lineHeight\":\"1.2\"}},\"fontSize\":\"x-large\"} -->\n<p class=\"has-x-large-font-size\" style=\"line-height:1.2\">Animated dunk</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns {\"style\":{\"spacing\":{\"blockGap\":{\"top\":\"var:preset|spacing|30\",\"left\":\"var:preset|spacing|30\"}}}} -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph {\"style\":{\"layout\":{\"selfStretch\":\"fill\",\"flexSize\":null}}} -->\n<p>Floating through the skies, <em>papa jump </em>defying physics. Following through Numencaniq\'s <a href=\"https://www.domestika.org/en/courses/235-animacion-2d-con-photoshop-dibujo-camara-y-accion\">2D camera course</a>, which is focused on framing and camera movements, I went through an experimentation path with Procreate Dreams. Organizing and planning a complex scene required an intense use of anatomy and imagination.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>By planning the dunk and cameras beforehand I was able to think on spacing, timing and extreme limb movements. Being able to have a mental map of what a flat movement could be allowed me to go quick and not overthink each of the positions, focusing on the impressions.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:group -->\n\n<!-- wp:group {\"style\":{\"spacing\":{\"padding\":{\"top\":\"var:preset|spacing|10\",\"bottom\":\"var:preset|spacing|10\",\"left\":\"var:preset|spacing|10\",\"right\":\"var:preset|spacing|10\"},\"blockGap\":\"0\",\"margin\":{\"top\":\"0\",\"bottom\":\"0\"}},\"dimensions\":{\"minHeight\":\"0px\"},\"border\":{\"radius\":\"0px\"}},\"backgroundColor\":\"base\",\"layout\":{\"type\":\"default\"}} -->\n<div class=\"wp-block-group has-base-background-color has-background\" style=\"border-radius:0px;min-height:0px;margin-top:0;margin-bottom:0;padding-top:var(--wp--preset--spacing--10);padding-right:var(--wp--preset--spacing--10);padding-bottom:var(--wp--preset--spacing--10);padding-left:var(--wp--preset--spacing--10)\"><!-- wp:heading {\"level\":3,\"style\":{\"spacing\":{\"padding\":{\"top\":\"var:preset|spacing|10\",\"bottom\":\"var:preset|spacing|10\"}}}} -->\n<h3 class=\"wp-block-heading\" style=\"padding-top:var(--wp--preset--spacing--10);padding-bottom:var(--wp--preset--spacing--10)\">Process</h3>\n<!-- /wp:heading -->\n\n<!-- wp:group {\"style\":{\"spacing\":{\"padding\":{\"top\":\"var:preset|spacing|20\",\"bottom\":\"var:preset|spacing|20\",\"left\":\"0\",\"right\":\"0\"},\"margin\":{\"top\":\"0\",\"bottom\":\"0\"},\"blockGap\":\"0\"},\"dimensions\":{\"minHeight\":\"0px\"},\"border\":{\"width\":\"0px\",\"style\":\"none\",\"radius\":\"0px\"}},\"layout\":{\"type\":\"default\"}} -->\n<div class=\"wp-block-group\" style=\"border-style:none;border-width:0px;border-radius:0px;min-height:0px;margin-top:0;margin-bottom:0;padding-top:var(--wp--preset--spacing--20);padding-right:0;padding-bottom:var(--wp--preset--spacing--20);padding-left:0\"><!-- wp:group {\"style\":{\"spacing\":{\"blockGap\":\"var:preset|spacing|30\",\"margin\":{\"top\":\"0\",\"bottom\":\"0\"},\"padding\":{\"right\":\"0\",\"left\":\"0\",\"top\":\"0\",\"bottom\":\"var:preset|spacing|40\"}},\"border\":{\"width\":\"0px\",\"style\":\"none\"}},\"className\":\"pj-contentrow1\",\"layout\":{\"type\":\"flex\",\"flexWrap\":\"nowrap\",\"orientation\":\"horizontal\",\"verticalAlignment\":\"top\",\"justifyContent\":\"center\"}} -->\n<div class=\"wp-block-group pj-contentrow1\" style=\"border-style:none;border-width:0px;margin-top:0;margin-bottom:0;padding-top:0;padding-right:0;padding-bottom:var(--wp--preset--spacing--40);padding-left:0\"><!-- wp:image {\"id\":84,\"sizeSlug\":\"full\",\"linkDestination\":\"none\",\"align\":\"right\"} -->\n<figure class=\"wp-block-image alignright size-full\"><img src=\"http://localhost:10003/wp-content/uploads/2024/06/character.png\" alt=\"\" class=\"wp-image-84\"/><figcaption class=\"wp-element-caption\">First step, making a character design with simplifed shapes, I added some personal notes to remember my character when animating.</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":86,\"sizeSlug\":\"full\",\"linkDestination\":\"none\",\"align\":\"right\"} -->\n<figure class=\"wp-block-image alignright size-full\"><img src=\"http://localhost:10003/wp-content/uploads/2024/06/poses.png\" alt=\"\" class=\"wp-image-86\"/><figcaption class=\"wp-element-caption\">Step two: I used some basketball references and practice gesture. </figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":104,\"scale\":\"contain\",\"sizeSlug\":\"full\",\"linkDestination\":\"none\",\"align\":\"left\"} -->\n<figure class=\"wp-block-image alignleft size-full\"><img src=\"http://localhost:10003/wp-content/uploads/2024/06/head.gif\" alt=\"\" class=\"wp-image-104\" style=\"object-fit:contain\"/><figcaption class=\"wp-element-caption\">Step three: A head turnout was very useful for practicing proportions and help me when getting into complex camera movements.</figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:group -->\n\n<!-- wp:group {\"style\":{\"spacing\":{\"blockGap\":\"var:preset|spacing|30\",\"padding\":{\"right\":\"0\",\"left\":\"0\",\"top\":\"0\",\"bottom\":\"0\"},\"margin\":{\"top\":\"0\",\"bottom\":\"0\"}},\"dimensions\":{\"minHeight\":\"0px\"},\"border\":{\"width\":\"0px\",\"style\":\"none\"}},\"className\":\"pj-contentrow2\",\"layout\":{\"type\":\"flex\",\"flexWrap\":\"nowrap\",\"orientation\":\"horizontal\",\"verticalAlignment\":\"top\",\"justifyContent\":\"